import React, { useEffect } from "react";
import "../style/project.css";
import ReactPlayer from "react-player";
import aos from "aos";
import "aos/dist/aos.css";
import Aos from "aos";
import LazyLoad from "react-lazyload";

const Project = () => {
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);

  return (
    <section data-aos="fade-up" className="section" id="project2">
      <LazyLoad>
        <div className="project-container">
          <div className="project-content">
            <h2>Steamind</h2>
            <p>Visualizing data from the popular game service Steam.</p>
            <ReactPlayer url="https://vimeo.com/526182623" />
          </div>
          <div className="project-info">
            <h3 className="h3">Steamind</h3>
            <span className="text-muted">Website</span>
            <p>
              Steamind is a tool for visualizing games from your own Steam
              library as well as other games from Steam that might suit your
              interests.
            </p>
            <ul className="list-unstyled list-line mb-5">
              <li>Data Visualization</li>
              <li>HTML/CSS</li>
              <li>Javascript</li>
              <li>D3.js</li>
            </ul>
          </div>
        </div>
      </LazyLoad>
    </section>
  );
};

export default Project;
